import React from 'react';
import './styles.css';

const App = () => {
    return (
        <>
            <pageBackground />
            <NewBubbleButton />
        </>
    );
}
// first commit comment

const pageBackground = () => {
    return (
        <body></body>
    );
}

const NewBubbleButton = () => {
    return (
        <button className="newBubbleButton">
            +
        </button>
    );
}
export default App;
